 import {Link, Redirect} from 'react-router-dom';

 import MerriamAPI from '../services/MerriamAPI';


 class DefinitionsContainer extends Component {

   state = {
     info: {}
   }

   async componentDidMount() {
       const data = await MerriamAPI.index();
       this.setState({info: data});
       console.log(this.setState.info);
   }


   render() {
     return (
       <>
         <section>
           <div>
             <h1>Words</h1>
             <hr />
           </div>
         </section>
       </>
     );
   }

 }

 export default DefinitionsContainer;
